import React from 'react'
import {Box, Button} from '@material-ui/core';
const FoodSearch = () => {
    return (
        <Box>
            <Button>Chicken</Button>
            <Button>Beef</Button>
            <Button>seafood</Button>
            <Button>Vegetable</Button>
        </Box>
    )
}

export default FoodSearch
